import './App.css';
import { Routes, Route } from 'react-router-dom';
import Login from './pages/Login';
import Home from './pages/Home';

function App() {
  return (
    <div>
      <Routes>
        <Route path='/'>
          <Home/>
        </Route>
        <Route path='/login'>
          <Login/>
        </Route>
      </Routes>
    </div>
  );
}

export default App;
